import React, { useState, useEffect } from 'react';
import axios from 'axios';

import '../../style/MainPage.css';

const MenuChats = () => {
    const [isVisibleChats, setVisibleChats] = useState(true);
    const [isSearchVisible, setSearchVisible] = useState(false);
    const [searchResults, setSearchResults] = useState([]); 
    const [user, setUser] = useState('');
    const [foundUser, setFoundUser] = useState(null);
    const [friends, setFriends] = useState([]);

    const chatBase = [
        ["Егор", true],
        ["Иван", false],
        ["Алексей", true],
        ["Максим", false],
        ["Никита", true],
        ["Сергей", true],
        ["Олег", false],
        ["Андрей", true],
        ["Дмитрий", false],
        ["Владимир", true]
    ];

    const handleSearchClick = () => {
        setVisibleChats(false);
        setSearchVisible(true);
    };

    const handleBackClick = () => {
        setVisibleChats(true);
        setSearchVisible(false);
        setFoundUser(null);
    };

    const handleUser = (event) => {
        event.preventDefault();
        const userInput = event.target.value;
        setUser(userInput); 
    };

    const handleSearch = async (event) => {
        try {
            const response = await axios.get('http://localhost:7000/api/search-user', { params: { userName: user } });
            const searchResults = response.data;

            if (Array.isArray(searchResults)) {
                setSearchResults(searchResults); 
                if (searchResults.length > 0) {
                    setFoundUser(searchResults[0]);
                } else {
                    setFoundUser(null);
                }
            } else {
                console.error('Search results is not an array:', searchResults);
            }
        } catch (e) {
            console.error('Ошибка при поиске:', e);
        }
    };

    const handleAddFriend = () => {
        if (foundUser) {
            setFriends([...friends, foundUser]);
            setFoundUser(null);
        }
    };

    return (
        <div className='container-my-chats'>
            <div>
                <svg onClick={handleBackClick} className='backSvg' width="60px" height="60px" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                    {/* SVG code */}
                </svg>

                <div className="main-search-container">
                    <input onChange={handleUser} onClick={handleSearchClick} className='inp-search' type="text" />
                    <button className="but-search" onClick={handleSearch}>Найти</button>
                </div>
            </div>

            {isSearchVisible ? (
                <div className='search-results'>
                    {searchResults.length > 0 ? (
                        searchResults.map((user, index) => (
                            <div key={index} className='block-chat'>
                                <div className="info-chat">
                                    <p className='name-user'>{user.nickname}</p>
                                    <button onClick={() => handleAddFriend(user)}>Добавить в друзья</button>
                                </div>
                            </div>
                        ))
                    ) : (
                        <p>Пользователь не найден</p>
                    )}
                </div>
            ) : (
                <div className='user-list'>
                    {friends.map((friend, index) => (
                        <div key={index} className='block-chat'>
                            <div className="info-chat">
                                <p className='name-user'>{friend.nickname}</p>
                            </div>
                        </div>
                    ))}
                    {chatBase.map((chat, index) => (
                        <div key={index} className={`block-chat ${chat[1] ? '' : 'hidden'}`}>
                            <div className="info-chat">
                                <p className='name-user'>{chat[0]}</p>
                                <span className='activ'>{chat[1] ? "online" : "offline"}</span>
                            </div>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
};

export default MenuChats;
